import React from 'react';

const NavBar = () => {
  return  (
  	<nav>
	    <div className="nav-wrapper orange lighten-3">
	    <h5 className="brand-logo girlNextDoor center">Westiny</h5>
	    <ul class="right hide-on-med-and-down">
        <li><a href="sass.html"><i class="material-icons">portrait</i></a></li>
        <li><a href="badges.html">Nome da Pessoa</a></li>
        <li><a href="collapsible.html"><i class="material-icons">settings</i></a></li>
        <li><a href="mobile.html"><i class="material-icons">subdirectory_arrow_right</i></a></li>
        <li><a href="mobile.html"><i class="material-icons">lock_outline</i></a></li>
        <li><a href="mobile.html"><i class="material-icons">cancel</i></a></li>
        <li><a href="mobile.html"><i class="material-icons">close</i></a></li>
        <li><a href="mobile.html"><i class="material-icons">first_page</i></a></li>
        <li><a href="mobile.html"><i class="material-icons">close</i></a></li>
        <li><a href="mobile.html"><i class="material-icons">forward</i></a></li>
      </ul>
	    </div>
	</nav>

	);
}

export default NavBar;
